import React from 'react';
import {Route, BrowserRouter, Switch} from 'react-router-dom';
import Home from './pages/Home';

const Routes = () => {
    return(
        <BrowserRouter>
            <Switch> 
                <Route path='/' exact component={Home}/>
            </Switch> 
        </BrowserRouter>
    )
}
export default Routes;
